import * as React from 'react';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';

export default function CheckBoxes({ onChange }) {
    const handleChange = (event) => {
        const { name, checked } = event.target;
        const label = event.target.parentElement.innerText;
        onChange(label, checked);
    };

    return (

        <FormGroup>
            <FormControlLabel
                control={<Checkbox className="custom-checkbox" name="checkbox1" onChange={handleChange}/>}
                label="красное вино"/>
            <FormControlLabel
                control={<Checkbox className="custom-checkbox" name="checkbox2" onChange={handleChange}/>}
                label="белое вино"/>

            <FormControlLabel
                control={<Checkbox className="custom-checkbox" name="checkbox3" onChange={handleChange}/>}
                label="мясо"/>

            <FormControlLabel
                control={<Checkbox className="custom-checkbox" name="checkbox4" onChange={handleChange}/>}
                label="рыба"/>

            <FormControlLabel
                control={<Checkbox className="custom-checkbox" name="checkbox5" onChange={handleChange}/>}
                label="курица"/>
        </FormGroup>
    );
}
